import React from 'react';
import '../../css/tweets/Tweet.css';
import TweetTitle from './tweetTitle.js';
import TwitterAccount from './twitterAccount.js';
import TweetText from './tweetText.js';

class Tweet extends React.Component {

    render() {

        return (
            <div>
                <div className="TweetHeader">
                    <div className="Toggle">
                    </div>
                    <TweetTitle />
                </div>

                <div className="TweetContent">

                    <TwitterAccount />
                    <TweetText />

                    <div className="TweetBtnContainer">
                        <div className="TweetBtn">Delete</div>
                        <div className="TweetBtn">Edit</div>                        
                    </div>

                </div>
              
            </div>

        );
    }
}

export default Tweet;
